import Fetch from 'isomorphic-unfetch';
import Link from 'next/link';

const News = props => (
  <div>
    <p>{props.newsList.totalResults}</p>
    {props.newsList.articles.map((e, index) => (
      <div key={index}>
        <p>{`Title: ${e.title}`}</p>
        <p>{`Author: ${e.author}`}</p>
      </div>
    ))}
  </div>
);
export default News;
